      - !ruby/object:RPG::EventCommand {i: 0, c: 101, p: [\bBut I'm certain that his methods for acquiring his goals are incorrect.]}
      - !ruby/object:RPG::EventCommand {i: 0, c: 101, p: ['\bThe time that I had spent playing together with Pokemon as a child have continually reminded me that the feelings and bonds that humans and Pokemon share are ']}
