      - !ruby/object:RPG::EventCommand {i: 0, c: 101, p: ['\bUnfortunately it is nigh impossible to articulate this point to my colleagues, whose decisions are only swayed by data and results.']}
      - !ruby/object:RPG::EventCommand {i: 0, c: 101, p: ['\bBut the truth is I have been carefully withholding information concerning my latest experiment, whose results will only reveal themselves after the Pokemon has ']}
