      - !ruby/object:RPG::EventCommand {i: 0, c: 101, p: ['\bI want to create a Pokemon that will reward the trainer that raises it with love and care with a truly spectacular display, one that reminds everyone who sees it ']}
      - !ruby/object:RPG::EventCommand {i: 0, c: 401, p: ['that even as the world continues to change for the worse, there is still a hope for better change...just as the seasons change from winter to spring.']}
      - !ruby/object:RPG::EventCommand {i: 0, c: 101, p: ['\bSadly I know that this will be my life''s last work, as I know that our leader will not be pleased that I have engaged in research that he will no doubt consider to be ']}
      - !ruby/object:RPG::EventCommand {i: 0, c: 401, p: [a waste of his precious resources.]}
      - !ruby/object:RPG::EventCommand {i: 0, c: 101, p: ['\bHowever with the destruction of our laboratory due to that... <i>abomination</i>... there is no better time for me to escape with my ']}
      - !ruby/object:RPG::EventCommand {i: 0, c: 401, p: [research.]}
      - !ruby/object:RPG::EventCommand {i: 0, c: 101, p: ['\bI know that the Cult of Perfection will hunt me down eventually and that I ultimately cannot see the results of my efforts come to fruition, which is where you, ']}
